import React, { useState } from 'react';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, CssBaseline, Container, Typography } from '@mui/material';
import { Inbox as InboxIcon, Mail as MailIcon } from '@mui/icons-material';

function App() {
  const [open, setOpen] = useState(false);

  const toggleDrawer = () => {
    setOpen(!open);
  };

  return (
    <div>
      <CssBaseline />
      <Drawer anchor="left" open={open} onClose={toggleDrawer}>
        <List>
          <ListItem button>
            <ListItemIcon>
              <InboxIcon />
            </ListItemIcon>
            <ListItemText primary="Sidebar Item 1" />
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <MailIcon />
            </ListItemIcon>
            <ListItemText primary="Sidebar Item 2" />
          </ListItem>
        </List>
      </Drawer>
      <div style={{ }}>
        <Container maxWidth="xl" style={{ backgroundColor: '#111115', minHeight: '100vh' }}>
        </Container>
      </div>
    </div>
  );
}

export default App;
